import "./App.css";
import { useState } from "react";

function App() {
  const [result, setResult] = useState();
  const [number, setNumber] = useState(); // Zustand für die Eingabe

  function countAndChangeState() {
    const resultValue = count(number);
    setResult(resultValue);
  }

  function count(number) {
    return 2 * number;
  }

  return (
    <div className="App">
      number:
      <input
        type="text"
        value={number}
        onChange={(e) => setNumber(e.target.value)}
      />
      <button onClick={countAndChangeState}>Press me to calculate</button>
      <textarea value={result} readOnly></textarea>
    </div>
  );
}

export default App;
